import { Autocomplete, Container, TextField, Typography } from "@mui/material";
import { Box } from "@mui/system";
import axios from "axios";
import React, {useState, useEffect} from 'react'
import Header from '../../Extras/Header'
import Admin_sidebar from '../../Extras/Admin_sidebar'
import './admin_style.css'

function Admin_Home() {
  const [data, setData] = useState([]);
  const [getCounty, setCounty] = useState([]);
  const [getState, setState] = useState([]);
  useEffect(() => {
    axios
      .get(
        "https://pkgstore.datahub.io/core/world-cities/world-cities_json/data/5b3dd46ad10990bca47b04b4739a02ba/world-cities_json.json"
      )
      .then((response) => {
        // console.log(response);
        setData(response.data);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);

  const country = [...new Set(data.map((item) => item.country))];
  // console.log(country);

  // console.log(data);

  const handleCountry = (event, value) => {
    let states = data.filter((state) => state.country === value);
    states = [...new Set(states.map((item) => item.name))];
    states.sort();

    setState(states);
  };


  return (
    <>
      <Admin_sidebar />
      <Header />
      <Container>
      <Typography>Dependent Select Field</Typography>
      <Autocomplete
        onChange={(event, value) => handleCountry(event, value)}
        id="country"
        getOptionLabel={(country) => `${country}`}
        options={country}
        isOptionEqualToValue={(option, value) => option.name === value.name}
        noOptionsText={"No Available Data"}
        renderOption={(props, country) => (
          <Box component="li" {...props} key={country} value={getCounty}>
            {country}
          </Box>
        )}
        renderInput={(params) => <TextField {...params} label="Search" />}
      />
      <Autocomplete
        id="city"
        getOptionLabel={(getState) => `${getState}`}
        options={getState}
        isOptionEqualToValue={(option, value) => option.name === value.name}
        noOptionsText={"No Available User"}
        renderOption={(props, getState) => (
          <Box component="li" {...props} key={getState}>
            {getState}
          </Box>
        )}
        renderInput={(params) => <TextField {...params} label="City" />}
      />
      {/* <Autocomplete /> */}
    </Container>






      <div className="card">
      <div className="card-body">
          <h2 style={{'textAlign':'center'}}>MEET THE TEAM</h2>
        <div className="card-group"  id='ABOUT' style={{'marginLeft':'-25%', 'marginTop':'-3%'}}>
      <div className="card">
        <img className="card-img-top" src={require("../../Extras/huzaifa.jpg")} alt="Card image cap"></img>
        <div className="card-body">
          <h5 className="card-title">HUZAIFA AKA CUTIE</h5>
          <p className="card-text">TEXT</p>
        </div>
        {/* <div className="card-footer">
          <small className="text-muted">Last updated 3 mins ago</small>
        </div> */}
      </div>
      <div className="card">
        <img className="card-img-top" src={require("../../Extras/maarij.jpg")} alt="Card image cap"></img>
        <div className="card-body">
          <h5 className="card-title">MAARIJ AMIR AKA SHAPATAR</h5>
          <p className="card-text">TEXT</p>
        </div>
      {/* <div className="card-footer">
        <small className="text-muted">Last updated 3 mins ago</small>
      </div> */}
    </div>
    <div className="card">
      <img className="card-img-top" src={require("../../Extras/rayan.jpg")} alt="Card image cap"></img>
      <div className="card-body">
        <h5 className="card-title">RAYAN AKA DATA SCIENTIST</h5>
        <p className="card-text">TEXT</p>
      </div>
      {/* <div className="card-footer">
        <small className="text-muted"></small>
      </div> */}
    </div>
    </div>
        </div>
      </div>

    </>
  )
}

export default Admin_Home
